            let content = $(""#comContent"").val();
            $.ajax({
                type: ""GET"",
                url: ""/Hotel/Comment?content="" + content,
                success: function (res) {
                    $(""#comment-container"").append(res);
                    $(""#comContent"").val("" "");
                }
            })
        })

        $(':radio').change(function () {
            console.log('New star rating: ' + this.value);
        });
    </script>
